import React from 'react';
import ReactDOM from 'react-dom';

const data = [
	{
		name: 'Charlie',
		job: 'Janitor',
	},
	{
		name: 'Mac',
		job: 'Bouncer',
	},
	{
		name: 'Dee',
		job: 'Aspiring actress',
	},
	{
		name: 'Dennis',
		job: 'Bartender',
	},
]

class TableHeader extends React.Component {
	render() {
		return (
			<thead>
				<tr>
					<th>Name</th>
					<th>Job</th>
				</tr>
			</thead>
		)
	}
}

class TableBody extends React.Component {
	render() {
		const rows = this.props.tableData.map((row, index) => {
			return (
				<tr key={index}>
					<td>{row.name}</td>
					<td>{row.job}</td>
				</tr>
			)
		})
		return (
			<tbody>
				{rows};
			</tbody>
		)
	}
}
class Table extends React.Component {
	render() {
		const propData = this.props.data;
		return (
			<table>
				<TableHeader />
				<TableBody tableData={propData} />
			</table>
		)
	}
}


ReactDOM.render(<Table data={data} />, document.getElementById('root'));
